import Navbar from './Navbar';
import "./Header.css";

function Header({onNav,toggleTheme}) {

    return (
        <header className="topnav">
            <div className="nav-area">
                <a href="/" ><img alt="" className="headerimage" src={require("./images/logo.jpg")}/>
                </a>
                <h1>Technology Expert</h1>
                <Navbar onNav={onNav}/>
                <button className="theme-button" onClick={toggleTheme}>Toggle Theme</button>

            </div>
        </header>
    );
};

export default Header;
